webpackJsonp([49982460650665],{1050:function(e,t){e.exports={data:{markdownRemark:{html:'<!--\n* Component: Repeater\n  * `childComponent` - what type of component is repeated\n  * `indexProp` - which property on `childComponent` instance receives the index - defaults to `data-index`\n  * `childProp` - which property on `childComponent` instance receives the data ~= `children[index]` - defaults to `children`\n  * `children` of Repeater can be an array of anything provided that the `childComponent` specified can handle it\n* Concept: Destructuring\n  * https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Destructuring_assignment\n  * http://www.ecma-international.org/ecma-262/6.0/#sec-destructuring-assignment\n  * Enhance Kitten\n    * add styles to layout images in a grid\n    * add support for `index` prop to get unique images\n* Concept: Template Literals\n    * https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Template_literals\n    * http://www.ecma-international.org/ecma-262/6.0/#sec-template-literals\n* Convention: explain Base and default exports\n* Concept: introduce rest operator (order in arglist and attributes)\n  * https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Spread_operator\n* Convention: props and rest\n* Convention: delete invalid props from rest\n-->\n<p>In the <a href="../reusable-components/">second step</a>, we started breaking down our app into reusable components. Next, we’ll introduce Repeaters and Lists to help us stamp out multiple instances of a component. Along the way, we’ll also cover a few more ES6 concepts: destructuring, template literals, and the rest operator.</p>\n<h2 id="repeaters-and-lists"><a href="#repeaters-and-lists" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Repeaters and Lists</h2>\n<p>A list is a basic building block for any application. Whether its a grid of images (as in our case), a newsfeed, a product catalog, or shopping cart, each can be implemented by a component that maps an array of data onto an array of component instances. The most basic version in Enact is the <code class="language-text">Repeater</code>.</p>\n<h3 id="repeater"><a href="#repeater" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Repeater</h3>\n<p><code class="language-text">Repeater</code> requires two props: <code class="language-text">childComponent</code>, indicating the component to be repeated, and <code class="language-text">children</code>, providing the data to pass to each <code class="language-text">childComponent</code>. <code class="language-text">childComponent</code> can be either a React.Component or a string representing a DOM node name. <code class="language-text">children</code> must be an array, but the contents of the array depends upon the component being repeated.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">&lt;Repeater\n\tchildComponent={/* React.Component | string */}\n&gt;\n\t{/* Array */}\n&lt;/Repeater&gt;</code></pre>\n      </div>\n<p>For Kitten Browser, <code class="language-text">Kitten</code> will be the <code class="language-text">childComponent</code> and we’ll add an array of names as our data source, since our photos are random. We’ve also included an optional prop for Repeater, <code class="language-text">indexProp</code>, which configures the property of <code class="language-text">childComponent</code> that will receive the index of the data within the array.</p>\n<p>Below are the updates to <code class="language-text">./src/App/App.js</code>; the rest of the source has been omitted for brevity.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">import Repeater from &#39;@enact/ui/Repeater&#39;;\n\nconst kittens = [\n\t&#39;Garfield&#39;,\n\t&#39;Nermal&#39;,\n\t&#39;Simba&#39;,\n\t&#39;Nala&#39;,\n\t&#39;Tiger&#39;,\n\t&#39;Kitty&#39;\n];\n\nconst AppBase = kind({\n\tname: &#39;App&#39;,\n\n\trender: (props) =&gt; (\n\t\t&lt;div className={props.className}&gt;\n\t\t\t&lt;Repeater childComponent={Kitten} indexProp=&quot;index&quot;&gt;\n\t\t\t\t{kittens}\n\t\t\t&lt;/Repeater&gt;\n\t\t&lt;/div&gt;\n\t)\n});</code></pre>\n      </div>\n<h2 id="updating-kitten-for-repeater"><a href="#updating-kitten-for-repeater" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Updating Kitten for Repeater</h2>\n<p>If you’ve been running the app as we go, you likely noticed a couple issues after adding Repeater — all of the instances of Kitten were stacked vertically and the images were all the same. The first issue is solvable with some CSS to properly format our component. Let’s add a new file, <code class="language-text">./src/components/Kitten/Kitten.less</code>, with the following contents:</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">.kitten {\n\tdisplay: inline-block;\n\tpadding: 12px;\n\ttext-align: center;\n}</code></pre>\n      </div>\n<p>And within <code class="language-text">Kitten.js</code>, add the <code class="language-text">import</code> …</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">import css from &#39;./Kitten.less&#39;;</code></pre>\n      </div>\n<p>… as well as the <code class="language-text">styles</code> block to apply the class …</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">styles: {\n\tcss,\n\tclassName: &#39;kitten&#39;\n},</code></pre>\n      </div>\n<p>… and the <code class="language-text">className</code> prop to the rendered <code class="language-text">&lt;div&gt;</code>.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">render: (props) =&gt; (\n\t&lt;div className={props.className}&gt;\n\t\t&lt;img src={props.url} /&gt;\n\t\t&lt;div&gt;{props.children}&lt;/div&gt;\n\t&lt;/div&gt;\n)</code></pre>\n      </div>\n<p>This will allow the images to be displayed inline and will add some basic visual styling.</p>\n<p>The second issue will require us to take advantage of the <code class="language-text">index</code> property we configured on the Repeater. <a href="http://loremflickr.com">loremflickr</a>’s API allows us to select a different image with the same parameters using the <code class="language-text">random</code> query string parameter. Since we externalized the URL generation to a query string parameter, we’ll update that function to forward our <code class="language-text">index</code> prop along as the value of the <code class="language-text">random</code> parameter.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">computed: {\n\turl: ({index, size}) =&gt; {\n\t\treturn `//loremflickr.com/${size}/${size}/kitten?random=${index}`;\n\t}\n},</code></pre>\n      </div>\n<p>Finally, add <code class="language-text">index</code> to the <code class="language-text">propTypes</code>.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">propTypes: {\n\tchildren: PropTypes.string,\n\tindex: PropTypes.number,\n\tsize: PropTypes.number\n},</code></pre>\n      </div>\n<p>We’ve introduced a couple new ES6 features in this update. The unique function parameter in the computed property above is an example of destructuring and the backtick string is a template literal. Both are covered in more detail below.</p>\n<h3 id="destructuring"><a href="#destructuring" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Destructuring</h3>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Destructuring_assignment">Destructuring</a> (<a href="http://www.ecma-international.org/ecma-262/6.0/#sec-destructuring-assignment">spec</a>) is a new language feature of ES6 that allows you to extract the properties of an object into local variables. The basic syntax is:</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">const obj = {a: 1, b: 2, c: 3};\nconst {a, b} = obj; // == const a = obj.a, b = obj.b;</code></pre>\n      </div>\n<p>The basic syntax assumes you want the local variable to match the name of the property. You can also rename the local variable by appending <code class="language-text">: newName</code>:</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">const {a: myA, b} = obj; // == const myA = obj.a, b = obj.b;</code></pre>\n      </div>\n<p>As you saw above, you can also destructure an object received as an argument to a function:</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">url: ({index, size}) =&gt; {\t// == url: (props) =&gt; { const index = props.index, size = props.size;\n\treturn `//loremflickr.com/${size}/${size}/kitten?random=${index}`;\n}</code></pre>\n      </div>\n<p>Destructuring is particularly useful in React because your render methods and computed properties will receive their input as a property object, which you can deconstruct into the relevant properties.</p>\n<h3 id="template-literals"><a href="#template-literals" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Template Literals</h3>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Template_literals">Template literals</a> (<a href="http://www.ecma-international.org/ecma-262/6.0/#sec-template-literals">spec</a>) are a new string type in ES6 that support multi-line strings, expression interpolation, and tagged templates.</p>\n<p>Although an in-depth exploration of template literals is out of scope for this tutorial, it is worth noting that we’ve used expression interpolation in our computed <code class="language-text">url</code> prop. Within a template literal, an expression is denoted by a leading <code class="language-text">${</code>, followed by the expression, with a closing <code class="language-text">}</code>. Our example only inserts a variable, but any valid JavaScript expression can be used within the delimiters.</p>\n<h3 id="rest-and-spread-operators"><a href="#rest-and-spread-operators" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Rest and Spread Operators</h3>\n<p>The final new ES6 features we’ll introduce here are the rest and spread operators. You will often see these used within an stateless component’s render method. When used with destructuring, the rest operator places any property not destructured into a new object. The following example destructures <code class="language-text">children</code> and <code class="language-text">url</code> and places any remaining properties in the <code class="language-text">rest</code> object.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">render: ({children, url, ...rest}) =&gt; {</code></pre>\n      </div>\n<p>The spread operator spreads the properties of an object into a new object. In JavaScript, the spread operator can be used to clone an object or merge it with another.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">const obj = {a: 1, b: 2, c: 3};\nconst cloned = {...obj};\t\t// = {a: 1, b: 2, c: 3}\nconst merged = {...obj, d: 4};\t// = {a: 1, b: 2, c: 3, d: 4}</code></pre>\n      </div>\n<p>When used with additional properties, the order in which the spread operator is used is important. Any properties with conflicting names that precede the spread object will by overwritten by the object and any properties with conflicting names that follow the spread object will overwrite the object.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">const obj = {a: 1, b: 2, c: 3};\nlet merged = {a: 4, ...obj};\t\t// = {a: 1, b: 2, c: 3}\nmerged = {...obj, c: 4};\t\t\t// = {a: 1, b: 2, c: 4}</code></pre>\n      </div>\n<p>The spread operator can also be used within an expression in JSX to pass any properties not explicitly used onto another component. This is a useful way to allow standard properties (e.g. <code class="language-text">className</code> and <code class="language-text">style</code>), event handlers, or other valid DOM attributes to be specified on your component without explicitly routing them yourself.</p>\n<p>Below, we’ve spread <code class="language-text">rest</code> to our root element. This allows <code class="language-text">className</code> (which was injected by the <code class="language-text">styles</code> block) to be applied to our root element automatically, as well as any other props passed into our component.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">render: ({children, url, ...rest}) =&gt; {\n\treturn (\n\t\t&lt;div {...rest}&gt;\n\t\t\t&lt;img src={url} /&gt;\n\t\t\t&lt;div&gt;{children}&lt;/div&gt;\n\t\t&lt;/div&gt;\n\t);\n}</code></pre>\n      </div>\n<blockquote>\n<p>The convention in Enact is to use <code class="language-text">rest</code> as the variable name for the remaining props. It is semantically clear (the <code class="language-text">rest</code> of the props) and less ambiguous than <code class="language-text">props</code> which could refer to all the props.</p>\n</blockquote>\n<h3 id="omitting-invalid-props"><a href="#omitting-invalid-props" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Omitting Invalid Props</h3>\n<p>If you have updated the app as we’ve been going, you might have noticed a warning in the console when running the app.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">warning.js:36 Warning: Unknown prop `index` on &lt;div&gt; tag.</code></pre>\n      </div>\n<p>Quoting the <a href="https://facebook.github.io/react/warnings/unknown-prop.html">React docs</a>:</p>\n<blockquote>\n<p>The unknown-prop warning will fire if you attempt to render a DOM element with a prop that is not recognized by React as a legal DOM attribute/property. You should ensure that your DOM elements do not have spurious props floating around.</p>\n</blockquote>\n<p>In other words, if your component declares properties that are not valid HTML attributes <em>and</em> you are using the spread operator to push the remaining props onto the root element, you must first remove those custom props to prevent them from being applied to the DOM node. The convention in Enact is to delete each prop individually from <code class="language-text">rest</code>.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">render: ({children, url, ...rest}) =&gt; {\n\tdelete rest.index;\n\tdelete rest.size;\n\n\treturn (\n\t\t&lt;div {...rest}&gt;\n\t\t\t&lt;img src={url} /&gt;\n\t\t\t&lt;div&gt;{children}&lt;/div&gt;\n\t\t&lt;/div&gt;\n\t);\n}</code></pre>\n      </div>\n<h2 id="conclusion"><a href="#conclusion" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Conclusion</h2>\n<p>We’ve introduced the Repeater component to give us a litter of kittens and several new ES6 features including destructuring, template literals, and the complementary rest and spread operators to reduce our coding boilerplate to a minimum.</p>\n<p><strong>Next: <a href="../panels/">Organizing your App with Panels</a></strong></p>\n<p>Also, here’s the complete source of the App and Kitten components which incorporates all of our changes from above:</p>\n<p><strong>./src/components/App/App.js</strong></p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">import kind from &#39;@enact/core/kind&#39;;\nimport MoonstoneDecorator from &#39;@enact/moonstone/MoonstoneDecorator&#39;;\nimport React from &#39;react&#39;;\nimport Repeater from &#39;@enact/ui/Repeater&#39;;\n\nimport Kitten from &#39;../components/Kitten&#39;;\n\nconst kittens = [\n\t&#39;Garfield&#39;,\n\t&#39;Nermal&#39;,\n\t&#39;Simba&#39;,\n\t&#39;Nala&#39;,\n\t&#39;Tiger&#39;,\n\t&#39;Kitty&#39;\n];\n\nconst AppBase = kind({\n\tname: &#39;App&#39;,\n\n\trender: (props) =&gt; (\n\t\t&lt;div className={props.className}&gt;\n\t\t\t&lt;Repeater childComponent={Kitten} indexProp=&quot;index&quot;&gt;\n\t\t\t\t{kittens}\n\t\t\t&lt;/Repeater&gt;\n\t\t&lt;/div&gt;\n\t)\n});\nconst App = MoonstoneDecorator(AppBase);\n\nexport default App;\nexport {App, AppBase};</code></pre>\n      </div>\n<p><strong>./src/components/Kitten/Kitten.js</strong></p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">import kind from &#39;@enact/core/kind&#39;;\nimport PropTypes from &#39;prop-types&#39;;\nimport React from &#39;react&#39;;\n\nimport css from &#39;./Kitten.less&#39;;\n\nconst KittenBase = kind({\n\tname: &#39;Kitten&#39;,\n\n\tpropTypes: {\n\t\tchildren: PropTypes.string,\n\t\tindex: PropTypes.number,\n\t\tsize: PropTypes.number\n\t},\n\n\tdefaultProps: {\n\t\tsize: 300\n\t},\n\n\tstyles: {\n\t\tcss,\n\t\tclassName: &#39;kitten&#39;\n\t},\n\n\tcomputed: {\n\t\turl: ({index, size}) =&gt; {\n\t\t\treturn `//loremflickr.com/${size}/${size}/kitten?random=${index}`;\n\t\t}\n\t},\n\n\trender: ({children, url, ...rest}) =&gt; {\n\t\tdelete rest.index;\n\t\tdelete rest.size;\n\n\t\treturn (\n\t\t\t&lt;div {...rest}&gt;\n\t\t\t\t&lt;img src={url} /&gt;\n\t\t\t\t&lt;div&gt;{children}&lt;/div&gt;\n\t\t\t&lt;/div&gt;\n\t\t);\n\t}\n});\n\nexport default KittenBase;\nexport {KittenBase as Kitten};</code></pre>\n      </div>',frontmatter:{title:"Repeaters and Lists",github:"https://github.com/enactjs/docs/blob/develop/src/pages/docs/tutorials/tutorial-kitten-browser/lists/index.md"}},allMarkdownRemark:{edges:[{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/app-setup/"},frontmatter:{title:"App Setup"}}},{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/reusable-components/"},frontmatter:{title:"Reusable Components"}}},{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/lists/"},frontmatter:{title:"Repeaters and Lists"}}},{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/"},frontmatter:{title:"Kitten Browser"}}},{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/panels/"},frontmatter:{title:"Organizing Your App with Panels"}}},{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/data-and-state/"},frontmatter:{title:"State and Data Management"}}}]},site:{siteMetadata:{title:"I18N & L10N"}},docsPages:{edges:[{node:{path:"/docs/modules/",context:{title:null}}},{node:{path:"/docs/tutorials/",context:{title:null}}}]},jsMetadata:{edges:[{node:{fields:{slug:"/docs/tutorials/"},fileAbsolutePath:"/home/goun/Source/opensource_iLib/docs/src/pages/docs/tutorials/index.js",frontmatter:{title:"Internationalization"}}},{node:{fields:{slug:"/docs/modules/"},fileAbsolutePath:"/home/goun/Source/opensource_iLib/docs/src/pages/docs/modules/index.js",frontmatter:{title:"Getting Started"}}}]}},pathContext:{slug:"/docs/tutorials/tutorial-kitten-browser/lists/",title:"Repeaters and Lists",parentRegex:"/\\/docs\\/tutorials\\/tutorial-kitten-browser(\\/[^/]*)?\\/$/"}}}});